  'post_content' => '<!--themify_builder_static--><h1>Features</h1><h2>Shoppe is a multi-purpose WooCommerce theme that helps you to build professional ecommerce sites in minutes. It comes with the drag &amp; drop Themify Builder and many ecommerce features such as ajax cart, wishlist, quick look lightbox, ajax quick search, product image zoom/gallery, and tons of layout options.</h2>
<img loading="lazy" src="https://themify.me/demo/themes/shoppe/files/2020/09/overlay-705-705x446.png" width="705" height="446" title="overlay-705" alt="overlay-705" srcset="https://themify.me/demo/themes/shoppe/files/2020/09/overlay-705.png 705w, https://themify.me/demo/themes/shoppe/files/2020/09/overlay-705-300x190.png 300w, https://themify.me/demo/themes/shoppe/files/2020/09/overlay-705-600x380.png 600w" sizes="(max-width: 705px) 100vw, 705px" />
<h2>Instant<br/>Demos and Skins</h2>
<h3>Just install the free WooCommerce plugin and the Shoppe theme, then click demo importâwithin a minute, you will get an exact shop site like our demo. Shoppe theme offers additional theme skins that transform your site with a complete different look &amp; feel. Select a skin and click import demo, your site will be setup instantly like our demo.</h3>
