<img loading="lazy" src="https://themify.me/demo/themes/shoppe/files/2017/01/more-to-come-shoppe-360x230.jpg" width="360" height="230" title="More to come" alt="More to come" srcset="https://themify.me/demo/themes/shoppe/files/2017/01/more-to-come-shoppe.jpg 360w, https://themify.me/demo/themes/shoppe/files/2017/01/more-to-come-shoppe-300x192.jpg 300w" sizes="(max-width: 360px) 100vw, 360px" /> <h3> More to come </h3>
<h2>Drag & drop<br/>Builder Layout</h2>
<h3>Using Themify Builder, you can build almost design any layout as you can imagine and it is responsive. If time is a concern, simply import a pre-designed layout included in the theme. There are over 60+ regular layouts and 20+ shop landing page layouts.</h3>
<img loading="lazy" src="https://themify.me/demo/themes/shoppe/files/2016/12/shoppe-layouts-1200x517-1400x603.jpg" width="1400" height="603" title="shoppe layouts" alt="shoppe layouts" srcset="https://themify.me/demo/themes/shoppe/files/2016/12/shoppe-layouts.jpg 1400w, https://themify.me/demo/themes/shoppe/files/2016/12/shoppe-layouts-300x129.jpg 300w, https://themify.me/demo/themes/shoppe/files/2016/12/shoppe-layouts-768x331.jpg 768w, https://themify.me/demo/themes/shoppe/files/2016/12/shoppe-layouts-1200x517.jpg 1200w" sizes="(max-width: 1400px) 100vw, 1400px" />
<h2>Smart &<br/>Flexible Layouts</h2>
<h3>Shoppe theme includes tons of layout options. The layout resource files (CSS and Javascript) are smarly loaded when the layout is selected, making the theme load fast without having to load all unnecessary files. It is so flexible that you can select the layout either for the entire site or per page basis (ie. you can have a different layout on different pages if you wish).</h3>
<h4>14 Header Layouts</h4><h5>Over 14 header layout options are availableâwhether you like it minimal, tall, skinny, big, left, right, fullwidth, boxed, you got it!</h5>
<img loading="lazy" src="https://themify.me/demo/themes/shoppe/files/2020/09/split-menu-160x135.png" width="160" height="135" alt="Logo Center"> Logo Center
