<h2>UX Enhancements<br/>Details & Features</h2>
<h3>Building an ecommerce site has never been so easy with Shoppe theme. Impress visitors with these shop featuresâthey will sure make your shop like a big brand.</h3>
<img loading="lazy" width="360" height="243" src="https://themify.me/demo/themes/shoppe/files/2017/01/ajax-cart.gif" title="Ajax Cart" alt="When users adds an item to cart, it instantly updates the dropdown cart on the header without reloading the page. Users can view the cart total and as well remove items on the ajax cart."> <h3> Ajax Cart </h3> When users adds an item to cart, it instantly updates the dropdown cart on the header without reloading the page. Users can view the cart total and as well remove items on the ajax cart.

<img loading="lazy" width="360" height="243" src="https://themify.me/demo/themes/shoppe/files/2017/01/wishlist-animation.gif" title="Wishlist" alt="Wishlist feature allows users to add their favorite items which can revisit later. When an item is wishlisted, there is a sparkling animation to enhance user experience."> <h3> Wishlist </h3> Wishlist feature allows users to add their favorite items which can revisit later. When an item is wishlisted, there is a sparkling animation to enhance user experience.
<img loading="lazy" width="360" height="243" src="https://themify.me/demo/themes/shoppe/files/2016/12/quicklook.gif" title="Quick Look" alt="Quick look allows users to view the details of an item in a lightbox without going to the product page. A nifty flipping animation will show when the quick look lightbox is loading."> <h3> Quick Look </h3> Quick look allows users to view the details of an item in a lightbox without going to the product page. A nifty flipping animation will show when the quick look lightbox is loading.
<img loading="lazy" width="360" height="243" src="https://themify.me/demo/themes/shoppe/files/2017/01/gallery-slider-animation.gif" title="Gallery Slider" alt="On archive porduct, when the product image is hovered, an ajax product gallery slider will appear allowing the user to see all product images."> <h3> Gallery Slider </h3> On archive porduct, when the product image is hovered, an ajax product gallery slider will appear allowing the user to see all product images.
<img loading="lazy" width="360" height="243" src="https://themify.me/demo/themes/shoppe/files/2016/12/image-zoom.gif" title="Image Zoom" alt="Image zoom allows users to click to view the large version of the product image. It works on desktop, tablet, and mobile."> <h3> Image Zoom </h3> Image zoom allows users to click to view the large version of the product image. It works on desktop, tablet, and mobile.
<img loading="lazy" width="360" height="243" src="https://themify.me/demo/themes/shoppe/files/2017/01/share-animation.gif" title="Product Share" alt="A convenient share button is placed next to the buy button. Having an easy-to-access share button increases sharing rate."> <h3> Product Share </h3> A convenient share button is placed next to the buy button. Having an easy-to-access share button increases sharing rate.
<img loading="lazy" width="565" height="385" src="https://themify.me/demo/themes/shoppe/files/2017/01/ajax-search.gif" title="Ajax Search" alt="One of the powerful features in Shoppe theme is the ajax search function. It allows users to quickly search anything on your site and filter the search results between the blog posts and products."> <h3> Ajax Search </h3> One of the powerful features in Shoppe theme is the ajax search function. It allows users to quickly search anything on your site and filter the search results between the blog posts and products.

